import React from 'react';
import './navbar.css'



const navbar = () => {
    return (
        <div className='navbarWrapper'>
            <div className='navbarContainer'>
                    <p className='navbarItem'>Home</p>
                    <p className='navbarItem'>Team</p>
                    <p className='navbarItem'>Gärtnerei</p>
                    <p className='navbarItem'>Landschaftsgärtner</p>
                    <p className='navbarItem'>Floristik</p>
                    <p className='navbarItem'>Grabbetreuung</p>
                    <p className='navbarItem'>Kontakt</p>
                    <p className='navbarItem'>Impressum</p>
                    <p className='navbarItem'>Social Media</p>
                    <p>TestBox</p>
            </div>
        </div>
    );
};
export default navbar;
